    false,nt"url": null,nt"notes": "These files contain topographic lidar data
    classified as ground (2) and unclassified (1) in accordance with the American Society
    for Photogrammetry and Remote Sensing (ASPRS) classification standards. These data
    were collected by the Compact Hydrographic Airborne Rapid Total Survey (CHARTS)
    system along the gulf coast of Florida from June 20 - July 22, 2010. The area of
    coverage includes the coastline in the following counties: Charlotte, Collier, Hillsborough,
    Lee, Manatee, Pasco, Pinellas, and Sarasota. CHARTS integrates topographic and bathymetric
    lidar sensors, a digital camera and a hyperspectral scanner on a single remote sensing
    platform for use in coastal mapping and charting activities. Data coverage generally
    extends along the coastline from the waterline inland 500 meters (topography) and
    offshore 1,000 meters or to laser extinction (bathymetry). The topographic lidar
    sensor has a pulse repetition rate of 9 kHz at 1064 nm (near-infrared wavelength).
    The bathymetric lidar sensor has a pulse repetition rate of 1 kHz at 532 nm (green
    wavelength). Native lidar data is not generally in a format accessible to most Geographic
    Information Systems (GIS). Specialized in-house and commercial software packages
    are used to process the native lidar data into 3-dimensional positions that can
    be imported into GIS software for visualization and further analysis. The data were
    provided to NOAA CSC in decimal degrees of latitude and longitude, referenced to
    the North American Datum of 1983 (NAD83). Vertical positions were referenced to
    the NAD83 ellipsoid and provided in meters. The National Geodetic Survey's (NGS)
    GEOID03 model was used to transform the vertical positions from ellipsoid to orthometric
    heights referenced to the North American Vertical Datum of 1988 (NAVD88). The format
    of the file was LAS version 1.1. For data storage and Digital Coast provisioning
    purposes, NOAA CSC converted the orthometric heights (NAVD88) back to ellipsoidal
    heights using GEOID03.",nt"license_title": null,nt"extras": [{ntt"key":
